import React from 'react';
import ReactDOM from 'react-dom';


const FindFriend = () => {
    return (
        <div>
            <h2 className="text-center">Friends List</h2>
            <div className = "row">
                <table className = "table table-striped table-bordered">

                    <thead>
                        <tr>
                            <th>Friends</th>
                            <th>Action</th>


                        </tr>
                    </thead>
                    <tbody>
                    <tr>
                            <th>Friend1</th>
                            <th>Accept/Reject</th>


                    </tr>
                    </tbody>


                </table>


            </div>
        </div>
    );
  };

export default FindFriend;
